parameters.inputSchema:
{
	"type": "object",
	"properties": {
		"forecastPeriod": {
			"type": "string",
			"description": "The forecast period (e.g., Q1 2024, Next 3 months)"
		},
		"totalRevenue": {
			"type": "number",
			"description": "Total aggregated revenue across all sources"
		},
		"incomeTaxLiability": {
			"type": "number",
			"description": "Predicted income tax liability"
		},
		"vatLiability": {
			"type": "number",
			"description": "Predicted VAT liability"
		},
		"gstLiability": {
			"type": "number",
			"description": "Predicted GST liability"
		},
		"withholdingTaxLiability": {
			"type": "number",
			"description": "Predicted withholding tax liability"
		},
		"totalTaxLiability": {
			"type": "number",
			"description": "Total predicted tax liability"
		},
		"forecast3Months": {
			"type": "object",
			"description": "Revenue and tax forecast for next 3 months"
		},
		"forecast6Months": {
			"type": "object",
			"description": "Revenue and tax forecast for next 6 months"
		},
		"forecast12Months": {
			"type": "object",
			"description": "Revenue and tax forecast for next 12 months"
		},
		"insights": {
			"type": "array",
			"description": "Key insights and recommendations",
			"items": {
				"type": "string"
			}
		},
		"trends": {
			"type": "array",
			"description": "Identified trends and patterns",
			"items": {
				"type": "string"
			}
		}
	}
}
